Käyttäjän on varustettava ohjelmisto ja ohjelmiston toiminnot (mukaan lukien, mutta ei rajoittuen, uusien instanssien luominen) käyttäjän vaatimalla laitteisto- ja ohjelmistokokoonpanolla.
Käyttäjät ovat vastuussa asiaankuuluvista puhelimen ja laajakaistan käyttömaksuista, jotka on maksettava Internet-yhteyden muodostamisen jälkeen.
Käyttäjällä on laillinen vastuu tämän ohjelmiston käytön aiheuttamasta käyttäytymisestä, tapahtumasta ja tuloksesta.
Käyttäjien ja muiden luvattomien epävirallisten henkilöiden välisillä tapahtumilla ja riidoilla ei ole mitään tekemistä kehittäjän kanssa.
Käyttäjän on noudatettava Kiinan kansantasavallan asiaankuuluvia lakeja ja määräyksiä (jos käyttäjä on Kiinan kansantasavallan ulkopuolinen käyttäjä, käyttäjän on noudatettava myös sen maan tai alueen lakeja ja määräyksiä, johon hän kuuluu).
Käyttäjä ei saa käyttää ohjelmistoa (tai joitakin ohjelmiston ominaisuuksia ja toimintoja) laittomiin toimiin eikä käyttää ohjelmistoon liittyviä prosesseja ja palveluita laittomiin toimiin, eivätkä toimien seuraukset liity kehittäjään.
Käyttäjät kantavat omat julkaisemansa tiedon sisältöön liittyvät oikeudelliset vastuunsa. Käyttäjä ei saa syöttää, julkaista tai levittää mitään seuraavista sisällöistä ohjelmistossa, prosesseissa ja palveluissa, jotka liittyvät ohjelmiston toimintaan, eikä julkaista mitään seuraavista sisällöistä missään muodossa：

vastustaa Kiinan kansantasavallan perustuslaissa vahvistettuja perusperiaatteita;
kansallisen turvallisuuden vaarantaminen, valtionsalaisuuksien paljastaminen, valtiovallan horjuttaminen tai kansallisen yhtenäisyyden heikentäminen;
vahingoittaa valtion kunniaa ja etuja;
etniseen vihaan ja syrjintään yllyttäminen tai etnisen yhtenäisyyden heikentäminen;
kansallisen uskonnollisen politiikan heikentäminen, kulttien ja feodaalisen taikauskon puolustaminen;
huhujen levittäminen, sosiaalisen järjestyksen häiritseminen tai sosiaalisen vakauden heikentäminen;
säädyttömyyden, pornografian, uhkapelien, väkivallan, murhien, terrorin levittäminen tai rikoksiin yllyttäminen;
muiden loukkaaminen tai panettelu, muiden laillisten oikeuksien ja etujen loukkaaminen;
Sisältää muuta sisältöä, jonka Kiinan kansantasavalta on kieltänyt laeilla tai hallinnollisilla määräyksillä.
Ellei laki sitä salli tai kehittäjän kirjallisella luvalla, käyttäjät eivät saa ryhtyä mihinkään seuraavista toimista：
Ohjelmiston ja palveluiden laiton tai sopimaton käyttö;
vahingoittaa ohjelmistojärjestelmän tai verkkosivuston normaalia toimintaa, levittää tarkoituksellisesti tietokoneviruksia ja muita tuhoisia ohjelmia;
Epänormaali käyttökäyttäytyminen, joka voi vaikuttaa ohjelmiston verkkopalveluihin (mukaan lukien, mutta ei rajoittuen, vahingoittaminen, palvelimeen hyökkääminen tai palvelimen ylikuormitus jne.);
Poista tekijänoikeustiedot ohjelmistosta ja sen kopioista.

Jos käyttäjä toimii lakien ja määräysten vastaisesti tai rikkoo tämän sopimuksen määräyksiä, kehittäjällä on oikeus ryhtyä toimenpiteisiin käyttäjää vastaan tilanteen vakavuuden mukaan tämän sopimuksen sekä lakien ja määräysten mukaisesti, mukaan lukien, mutta ei rajoittuen, palvelujen lopettaminen. Jos olosuhteet ovat vakavat, ne siirretään asianomaisille hallintoelimille hallinnollista rangaistusta varten tai tutkitaan rikosoikeudellista vastuuta varten.

Jos hyväksyt nämä käyttöehdot ja käytät ohjelmiston verkkopalveluja, keräämme seuraavat tiedot:：
sen laitteen IP-osoite, jossa ohjelmisto on käynnissä (joka ei välttämättä ole oikea osoite);
Jotkin järjestelmätiedot laitteista, joissa ohjelmisto toimii;
Kun ohjelmisto kaatuu, järjestelmässä käynnissä olevan ohjelmiston lokit (mukaan lukien jotkin järjestelmätiedot) voidaan ladata käyttäjän suostumuksella ongelman ratkaisemiseksi ja ohjelmiston parantamiseksi.
Muut tiedot, jotka ladataan käyttäjän suostumuksella (kuten ohjelmistossa on määritetty).

1. Käyttäjän palvelun keskeyttäminen ja lopettaminen

Jos käyttäjä julkaisee laittomia tietoja, rikkoo vakavasti sosiaalista moraalia tai rikkoo lain kieltoja, kehittäjän on lopetettava palvelujen tarjoaminen käyttäjälle;
Jos käyttäjä tekee virheellisen teon hyväksyessään ohjelmistopalvelun, kehittäjällä on oikeus lopettaa käyttäjälle tarjottu palvelu (virheellisen käyttäytymisen erityiset olosuhteet on määritelty selvästi tässä sopimuksessa);
Jos käyttäjä käyttää kolmannen osapuolen muokattua ohjelmistoversiota, käyttäjä kantaa oman riskinsä ja oikeudellisen vastuunsa.

2. Ohjelmiston ja palveluiden keskeyttäminen, keskeyttäminen ja lopettaminen：

Seuraavissa tapauksissa kehittäjällä on oikeus lopettaa tai keskeyttää ohjelmiston palvelut kokonaan tai osittain, eikä kehittäjä ole vastuussa käyttäjälle tai millekään kolmannelle osapuolelle tästä aiheutuneesta haitasta tai vahingosta：

a. ohjelmiston ja palveluiden edellyttämällä tavalla;
b. Epäonnistuminen toimii oikein palvelimen vaurioitumisen vuoksi;
c. Ohjelmisto- ja laitteistolaitteiden sekä sähköisten viestintälaitteiden äkillisen vian vuoksi;
d. verkko-operaattorin linjan tai muiden vikojen vuoksi;
e. poliittisista syistä;
f. Kolmannen osapuolen syyt tai muut ylivoimaiset esteet.

Kehittäjä pidättää oikeuden lopettaa tai osittain lopettaa Ohjelmiston ja Palvelut, kun se katsoo sen tarpeelliseksi, ja Kehittäjä voi ilmoittaa asiasta Käyttäjälle ilmoituksen muodossa, mutta Kehittäjä ei ole vastuussa Käyttäjälle aiheutuneista menetyksistä.

Tähän sopimukseen sovelletaan Kiinan kansantasavallan lainsäädäntöä ottamatta huomioon kaikkia lainvalintasäännöksiä;
Se, että Kehittäjä ei käytä, käytä ajoissa tai käytä täysimääräisesti tämän sopimuksen mukaisia tai lain mukaisia oikeuksiaan, ei tarkoita luopumista tällaisten oikeuksien käytöstä, eikä se vaikuta Kehittäjän tällaisten oikeuksien käyttöön tulevaisuudessa;
Kehittäjällä on lain sallimissa rajoissa oikeus tulkita tämän sopimuksen ehtoja;
Käyttäjät voivat valittaa ja ilmoittaa kaikenlaisista lakien ja määräysten rikkomuksista sähköpostitse, lähetä sähköpostia services@mcsl.com.cn.
